import React, { Component } from "react";
import {Rate} from "antd";
import Button from "antd/es/button";
import Avatar from "antd/es/avatar";
import UserOutlined from "@ant-design/icons/lib/icons/UserOutlined";

class StudentProfileManagerComponent extends Component {
    render() {
        return (
            <div className="student-profile-container">
                <div className="profile-detail-head">
                    <div className="profile-detail-head-wrapper" >
                        <div className="profile-detail-head-title">
                            <Avatar shape="square" size="large" icon={<UserOutlined />}  height="120px" width="120px" className="project-img"/>
                            <img src="https://assets.laioffer.com/public/companyLogo/9b7556fe-3187-4f58-b290-b9a1348db9a3.png" height="120px" width="120px" className="project-img"/>
                            <div className="profile-title-right">
                                <h2>Project name</h2>
                                <span>company name</span><br/>
                                <span>time</span><br/>
                                <Rate disabled defaultValue={4.9} />
                            </div>
                        </div>
                        <div className="profile-edit">
                            <Button type="primary" shape="round" size="large">
                                Apply
                            </Button>
                        </div>
                        <div className="profile-clear"></div>
                    </div>
                </div>
            </div>
        );
    }
}

export default StudentProfileManagerComponent;
